import React from "react";

const TasksFilterAll =() =>  {
            return (
            <li>
                 <button
                    onClick = {() => console.log('All')}>
                    All
                 </button>
             </li>);
};

const TasksFilterCompleted =() =>  {
    return (
        <li>
            <button
                onClick = {() => console.log('Completed')}>
                Completed
            </button>
        </li>);
};

const TasksFilterActive =({onActiveVision,classNames}) =>  {
    return (
        <li>
            <button
                className={classNames}
                onClick = {()=>onActiveVision()}>
                Active
            </button>
        </li>);
};

const TasksFilterClear =({onClearCompleted}) => {
        return (
            <button
                onClick = {()=>onClearCompleted()}>
                Clear Completed
            </button>
        );
};

export {
    TasksFilterAll,TasksFilterCompleted,TasksFilterActive,TasksFilterClear
}
